function report(test, results) {
    const [data, message] = results;
    if(message === true) {
        console.log("%s: \x1b[32m✓ %s\x1b[m", test, "Test passed");
    } else {
        console.log("%s: \x1b[31m× %s\x1b[m", test, message);
    }
}

function getpassphrase() {
    return new Promise((resolve, reject) => {
        // Taken from https://stackoverflow.com/a/59727173/2946845
        var readline = require("readline"),
            rl = readline.createInterface({
            input: process.stdin,
            output: process.stdout
        });
        rl.input.on("keypress", (c, k) => {
        // get the number of characters entered so far:
        var len = rl.line.length;
        // move cursor back to the beginning of the input:
        readline.moveCursor(rl.output, -len, 0);
        // clear everything to the right of the cursor:
        readline.clearLine(rl.output, 1);
        // replace the original input with asterisks:
        for (var i = 0; i < len; i++) {
            rl.output.write("*");
        }
        });

        rl.question("Enter your passphrase: ", pw => {
            resolve(pw);
            rl.close();
        });
    });
}

