let encryptedDataKey;
let encryptedData;
const tests = {
    "noPassphrase": () => {
        return new Promise((resolve, reject) => {
            fs.unlink(testKeyFileName, err=>{
                console.log("\nTest 1: Encryption and decryption using only a key file passphrase");
                if(!err) {
                    console.log("Previous key removed for test.");
                }
                CryptClient.init(testKeyFileName, keyFilePassphrase, privateKeyPassphrase ).then(client=>{
                    client.encrypt(Buffer.from(message)).then(([key, encrypted]) =>{
                        client=undefined;
                        CryptClient.init(testKeyFileName, keyFilePassphrase, privateKeyPassphrase ).then(client=>{
                            client.decrypt(key, encrypted, privateKeyPassphrase).then(decrypted => {
                                resolve([decrypted.toString().substring(0,498) ,true]);
                            }).catch( err => resolve([err,"Decryption failed"]));
                        }).catch( err => resolve([err,"Decrypter Initialisation failed"]));
                    }).catch( err => resolve([err,"Encryption failed"]));
                }).catch( err => resolve([err,"Encrypter Initialisation failed"]));
            });
        });
    },
    "passphrase": () => {
        return new Promise((resolve, reject) => {
            fs.unlink(testKeyFileName, err=>{
                console.log("\nTest 2: Encryption and decryption using both a key file passphrase and a private key passphrase");
                if(!err) {
                    console.log("Previous key removed for test.");
                }
                CryptClient.init(testKeyFileName, keyFilePassphrase, privateKeyPassphrase ).then(client=>{
                    client.encrypt(Buffer.from(message)).then(([key, encrypted]) =>{
                        client=undefined;
                        CryptClient.init(testKeyFileName, keyFilePassphrase, privateKeyPassphrase ).then(client=>{
                            client.decrypt(key, encrypted, privateKeyPassphrase).then(decrypted => {
                                resolve([decrypted.toString().substring(0,498) ,true]);
                            }).catch( err => resolve([err,"Decryption failed"]));
                        }).catch( err => resolve([err,"Decrypter Initialisation failed"]));
                    }).catch( err => resolve([err,"Encryption failed"]));
                }).catch( err => resolve([err, "Encrypter Initialisation failed"]));
            });
        });
    },
    "encrypt": () => {
        return new Promise((resolve, reject) => {
            fs.unlink(testKeyFileName, err=>{
                console.log("\nTest 3: Encryption only using user-entered private key passphrase");
                if(!err) {
                    console.log("Previous key removed for test.");
                }
                CryptClient.init(testKeyFileName, keyFilePassphrase, getpassphrase ).then(client=>{
                    client.encrypt(Buffer.from(message)).then(([key, encrypted]) =>{
                        encryptedDataKey=key;
                        encryptedData=encrypted;
                        resolve([encrypted.toString('hex') ,true]);
                    }).catch( err => resolve([err,"Encryption failed"]));
                }).catch( err => resolve([err, "Encrypter Initialisation failed"]));
            });
        });
    },
    "decrypt": () => {
        return new Promise((resolve, reject) => {
            console.log("\nTest 4: Decryption only using user-entered private key passphrase (Must match previously entered passphrase)");
            CryptClient.init(testKeyFileName, keyFilePassphrase ).then(client=>{
                client.decrypt(encryptedDataKey, encryptedData, getpassphrase).then(decrypted => {
                    resolve([decrypted.toString().substring(0,498) ,true]);
                }).catch( err => resolve([err,"Decryption failed"]));
            }).catch( err => resolve([err, "Encrypter Initialisation failed"]));
        });
    },
};

tests.noPassphrase().then((results) => {
    report(1, results);
    tests.passphrase().then((results) => {
        report(2, results);
        tests.encrypt().then((results) => {
            report(3, results);
            tests.decrypt().then((results) => {
                report(4, results);
                fs.unlink(testKeyFileName, err=>{
                    if(!err) {
                        console.log("Test complete; key removed")
                    }
                });
            });
        });
    });
});


